import React from "react";
import { UserPlus, Send, Users } from "lucide-react";

const Deshboard_CP = () => {
  return (
    <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mb-8">
      {/* Registered by You */}
      <div className="bg-white p-4 rounded-lg shadow-sm flex items-center space-x-4">
        <div className="bg-purple-100 p-3 rounded-full">
          <UserPlus className="h-6 w-6 text-purple-600" />
        </div>
        <div>
          <p className="text-sm text-gray-500">Registered by You (Today)</p>
          <p className="text-2xl font-bold">5</p>
        </div>
      </div>

      {/* Forwarded by You */}
      <div className="bg-white p-4 rounded-lg shadow-sm flex items-center space-x-4">
        <div className="bg-teal-100 p-3 rounded-full">
          <Send className="h-6 w-6 text-teal-600" />
        </div>
        <div>
          <p className="text-sm text-gray-500">Forwarded by You (Today)</p>
          <p className="text-2xl font-bold">3</p>
        </div>
      </div>

      {/* In Queue */}
      <div className="bg-white p-4 rounded-lg shadow-sm flex items-center space-x-4">
        <div className="bg-green-100 p-3 rounded-full">
          <Users className="h-6 w-6 text-green-600" />
        </div>
        <div>
          <p className="text-sm text-gray-500">In Dr. Kumar's Queue</p>
          <p className="text-2xl font-bold">4</p>
        </div>
      </div>
    </div>
  );
};

export default Deshboard_CP;
